import React from 'react'


const lakes = () => {
     fetch("https://www.hou")
    .then(res => res.json())
    .then(rsp => {
        return <div>{rsp}</div>
    })
}

const Home = () =>{
    
    return <div>
        <h1>THIS IS HOME</h1>
        <button onClick={()=>lakes()}>Call for Lakes</button>
        
    </div>
}
export default Home
